import React from 'react';
import BlogPost from './BlogPost';

const BlogList = ({post}) => {
    return (
        <div>
            {post.map((post, index)=> (
                <BlogPost key={index} title={post.title} content={post.content} image={post.image}/>
            ))}
        </div>
    );
}

export default BlogList;
